import React from "react";
import ReactDOM from "react-dom";
import TodoList from './components/todo-list';

const SearchPanel = () => {
  const searchStyle = {
    fontSize: '25px'
  };
  return (
    <input style = {searchStyle} placeholder = "search" />
  );
}
const Hed = () => {
  return (
    <h1>My to do List</h1>
  );
}
const ligbox = <span>Login please</span>;
const login = false;
const App = () => {
  const todoData = [
    { label: 'Drink coffee', important: false, id : 1},
    { label: 'Write code', important: true, id : 2},
    { label: 'Sleep', important: false, id :3}
  ];
  return (
    <div>
      {login ? null : ligbox }
      <Hed />
      <SearchPanel />
      <TodoList todos = {todoData}/>
    </div>
  );
}
const el = App();
ReactDOM.render(el, document.getElementById('root'));
